import DyteMap from './DyteMap';
export default class DyteRemoteMap extends DyteMap {
    constructor() {
        super({
            onAddEvent: 'remoteRequestAdd',
            onDeleteEvent: 'remoteRequestRemove',
        });
    }
    add(request, emitEvent = true) {
        return super.add(request, emitEvent);
    }
    delete(requestId, emitEvent = true, removeListeners = false) {
        return super.delete(requestId, emitEvent, removeListeners);
    }
}
